const Login = () => {
    return (
        <form className="login-form">
            <Field labelValue='Username' inputType='text'/>
            <Field labelValue='Password' inputType='password' />
            <button className="form-button" type='submit'>Login</button>
        </form>
    )
}

export default Login;
